🗣FERNANDO IGLESIAS REVELÓ QUÉ LE DIJO A ALBERTO FERNÁNDEZ

👉El siempre polémico diputado Fernando Iglesias fue uno de los protagonistas de la apertura de las sesiones ordinarias en el Congreso de la Nación, tras un fuerte cruce con Alberto Fernández durante su discurso. "Es un honor que me insulte", le había dicho el Presidente al legislador del PRO, quien, luego, reveló en exclusiva por C5N qué fue lo que le dijo.

@lautaromaislin
